function Invoke-Yara{
<#
.SYNOPSIS

.DESCRIPTION

.INPUTS

.OUTPUTS

.LINK
#>
    Param(
        [Parameter()]
		[Switch]$CSV, 
		
        [Parameter(<#Mandatory=$True#>, ValueFromPipeline=$True, HelpMessage="Computer name or IP address")]
		[String[]]$ComputerName,

        [Parameter(Position=0, Mandatory=$True)]
		[String]$RulesFile,

        [Parameter(ParameterSetName='FILE', Position=1, Mandatory=$True)]
		[String]$FileToScan,

        [Parameter(ParameterSetName='DIR', Position=1, Mandatory=$True)]
		[String]$DirToScan,

        [Parameter(ParameterSetName='PID', Position=1, Mandatory=$True)]
		[String]$PidToScan,

        [Alias("t")]
        [Parameter()]
		[String]$Tag,

        [Parameter()]
		[String]$Identifier,
        
        [Alias("n")]
        [Parameter()]
		[Switch]$Negate,

        [Alias("D")]
        [Parameter()]
		[Switch]$PrintModuleData,

        [Alias("g")]    
        [Parameter()]
		[Switch]$PrintTags,
    
        [Alias("m")]
        [Parameter()]
		[Switch]$PrintMeta,
        
        [Alias("s")]
        [Parameter()]
		[Switch]$PrintStrings,
        
        [Alias("e")]
        [Parameter()]
		[Switch]$PrintNamespace,
        
        [Alias("p")]
        [Parameter()]
		[Int32]$Threads,
        
        [Alias("l")]
        [Parameter()]
		[Int32]$MaxRules,

        [Alias("a")]
        [Parameter()]
		[Int32]$Timeout,
        
        [Alias("r")]
        [Parameter()]
		[Switch]$Recurse,
        
        [Alias("f")]
        [Parameter()]
		[Switch]$FastScan,
        
        [Alias("w")]
        [Parameter()]
		[Switch]$NoWarnings,

        [Alias("h")]
        [Parameter()]
        [Switch]$Help
    ) #End Param

    $Path = Resolve-Path $RulesFile

    if (! [IO.File]::Exists($Path))
    {
        Throw "RULES_FILE $Path does not exist."
    }

    $FileBytes = [IO.File]::ReadAllBytes($Path)

    $RulesFileLength = $FileBytes.Length
    $CompressedStream = New-Object IO.MemoryStream
    $DeflateStream = New-Object IO.Compression.DeflateStream ($CompressedStream, [IO.Compression.CompressionMode]::Compress)
    $DeflateStream.Write($FileBytes, 0, $FileBytes.Length)
    $DeflateStream.Dispose()
    $CompressedFileBytes = $CompressedStream.ToArray()
    $CompressedStream.Dispose()
    $EncodedCompressedRulesFile = [Convert]::ToBase64String($CompressedFileBytes)

    $CommandlineOptions = New-Object String[](0)
    switch ($PSBoundParameters.Keys) 
    {
                 'Negate' { $CommandlineOptions += '-n' } 
        'PrintModuleData' { $CommandlineOptions += '-D' }
              'PrintTags' { $CommandlineOptions += '-g' }
              'PrintMeta' { $CommandlineOptions += '-n' }
           'PrintStrings' { $CommandlineOptions += '-s' }
         'PrintNamespace' { $CommandlineOptions += '-e' }
                'Recurse' { $CommandlineOptions += '-r' }
               'FastScan' { $CommandlineOptions += '-f' }
             'NoWarnings' { $CommandlineOptions += '-w' }
    }

    $RemoteScriptBlock = {
        param($CommandlineOptions, $EncodedCompressedRulesFile, $ScanTarget)
            
            $ProcessorBitness = (Get-WmiObject Win32_Processor).AddressWidth
            if($ProcessorBitness -eq 32)
            {
                #Yara32
                $EncodedCompressedYara32 = @'

'@
                $DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedYara32),[IO.Compression.CompressionMode]::Decompress)
                $UncompressedYara = New-Object Byte[](708608)
                [void]$DeflatedStream.Read($UncompressedYara, 0, 708608)

                $YaraName = ([IO.Path]::GetRandomFileName()).Remove(9,3) + "exe"
                [void][IO.File]::WriteAllBytes("$env:TEMP\$YaraName", $UncompressedYara)
            }

            elseif($ProcessorBitness -eq 64)
            {
                #Yara64
                $EncodedCompressedYara64 = @'

'@
                $DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedYara64),[IO.Compression.CompressionMode]::Decompress)
                $UncompressedYara64 = New-Object Byte[](974848)
                [void]$DeflatedStream.Read($UncompressedYara64, 0, 974848)

                $YaraName = ([IO.Path]::GetRandomFileName()).Remove(9,3) + "exe"
                [void][IO.File]::WriteAllBytes("$env:TEMP\$YaraName", $UncompressedYara64)
            }

            else 
            { 
                Write-Error "$ProcessorBitness was not recognized as a compatible processor bitness." 
                break
            } 

            $DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedRulesFile),[IO.Compression.CompressionMode]::Decompress)
            $UncompressedRulesFile = New-Object Byte[]($RulesFileLength)
            [void]$DeflatedStream.Read($UncompressedRulesFile, 0, $RulesFileLength)

            $RulesFileName = [IO.Path]::GetRandomFileName()
            [void][IO.File]::WriteAllBytes("$env:TEMP\$RulesFileName", $UncompressedRulesFile)

            Write-Host "$env:TEMP\$YaraName $($CommandlineOptions -join ' ') $env:TEMP\$RulesFileName $ScanTarget"

            $YaraOutput = Invoke-Expression "$env:TEMP\$YaraName $($CommandlineOptions -join ' ') $env:TEMP\$RulesFileName $ScanTarget"
            Write-Output $YaraOutput

            Remove-Item -Path "$env:TEMP\$YaraName"
            Remove-Item -Path "$env:TEMP\$RulesFileName"
    }    
}
